INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_bodyHeadingCopy`, `field_bodyCopy`, `field_storeName`, `field_addressFirstLine`, `field_addressSecondLine`, `field_phoneNumber`, `field_faxNumber`, `field_saleInfoText`, `field_contactFormTitle`, `field_contactFormEmail`, `field_saleInfoTitle`, `field_saleInfoHanging`, `field_panelText`, `field_itemName`, `field_itemPrice`, `field_itemSerial`, `field_email`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'en_us', 'Frames', 'We service everything we sell for the lifetime of the frame for FREE.', '<p>Need an adjustment? Just stop by! If you ever sit on your glasses or bend them out of shape, make sure not to try to bend them back yourself, as we use specialized equipment in the shop to restore your frames to their natural shape!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p><strong><em>Interested in the top Eyewear lines? </em></strong>Check out our brands exclusive to our store in Baton Rouge!</p>', NULL, NULL, NULL, NULL, '2014-03-15 17:07:16', '2014-04-04 17:11:24', 'cb10a382-a7b6-40e1-b696-2c5230cc8693');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_bodyHeadingCopy`, `field_bodyCopy`, `field_storeName`, `field_addressFirstLine`, `field_addressSecondLine`, `field_phoneNumber`, `field_faxNumber`, `field_saleInfoText`, `field_contactFormTitle`, `field_contactFormEmail`, `field_saleInfoTitle`, `field_saleInfoHanging`, `field_panelText`, `field_itemName`, `field_itemPrice`, `field_itemSerial`, `field_email`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '4', 'en_us', 'About', 'We are a locally owned eyewear boutique with an exciting selection of classic, sophisticated eyewear. In business for over 30 years, the Optical Shoppe was the first luxury eyewear boutique in Baton Rouge.', '<p>We are known for fitting customers with the perfect frame in a relaxed comfortable friendly manner. Once you have your perfect frame, we can fit them with your prescription lenses. Our selection includes a variety of lenses and they will vary in price depending on what your eyes need. We offer an array of choices to all customers, including those with astigmatism. Whether you are nearsighted, farsighted, or both, we work with you to get the perfect lens/frame combination for your unique eyesight.</p><p>The Optical Shoppe is located in the Bocage Village shopping center with other local merchants including Dearman\'s and Calvin\'s grocery. If you lose your way, look for Le Madeline on the corner for a landmark.&nbsp;</p>', 'The Optical Shoppe', '7641 Jefferson Highway ', 'Baton Rouge, LA 7080', '225-928-5798', '225-926-2808', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2014-03-16 17:49:10', '2014-03-19 21:48:46', '6cc99547-a10e-4e76-9bc9-9013ac6df4ad');
