INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '2', '1', '1', 'en_us', NULL, '{\"authorId\":null,\"title\":\"Frames\",\"slug\":\"homepage\",\"postDate\":1395254159,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>Need an adjustment? Just stop by! If you ever sit on your glasses or bend them out of shape, make sure not to try to bend them back yourself, as we use specialized equipment in the shop to restore your frames to their natural shape!<\\/p>\",\"1\":\"<p>We service everything we sell for the lifetime of the frame for FREE.<\\/p>\",\"15\":\"\"}}', '2014-03-19 18:42:39', '2014-03-19 18:42:39', '22d509d6-d21c-474a-837f-49bbf68e4371');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('5', '2', '1', '1', 'en_us', NULL, '{\"authorId\":null,\"title\":\"Frames\",\"slug\":\"homepage\",\"postDate\":1395254159,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>Need an adjustment? Just stop by! If you ever sit on your glasses or bend them out of shape, make sure not to try to bend them back yourself, as we use specialized equipment in the shop to restore your frames to their natural shape!<\\/p>\",\"1\":\"We service everything we sell for the lifetime of the frame for FREE.\",\"15\":\"\"}}', '2014-03-19 19:01:07', '2014-03-19 19:01:07', '5047ce03-698b-4dc1-9a20-2c89e927c107');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('6', '2', '1', '1', 'en_us', NULL, '{\"authorId\":null,\"title\":\"Frames\",\"slug\":\"homepage\",\"postDate\":1395254159,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>Need an adjustment? Just stop by! If you ever sit on your glasses or bend them out of shape, make sure not to try to bend them back yourself, as we use specialized equipment in the shop to restore your frames to their natural shape!<\\/p>\",\"1\":\"We service everything we sell for the lifetime of the frame for FREE.\",\"15\":\"\"}}', '2014-03-19 19:01:09', '2014-03-19 19:01:09', '7b8e8e70-5f50-4510-8261-48f4e5e68821');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('7', '4', '3', '1', 'en_us', NULL, '{\"authorId\":null,\"title\":\"About\",\"slug\":\"about\",\"postDate\":1395254300,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"5\":\"7641 Jefferson Highway \",\"6\":\"Baton Rouge, LA 7080\",\"2\":\"<p>We are known for fitting customers with the perfect frame in a relaxed comfortable friendly manner. Once you have your perfect frame, we can fit them with your prescription lenses. Our selection includes a variety of lenses and they will vary in price depending on what your eyes need. We offer an array of choices to all customers, including those with astigmatism. Whether you are nearsighted, farsighted, or both, we work with you to get the perfect lens\\/frame combination for your unique eyesight.<\\/p><p>The Optical Shoppe is located in the Bocage Village shopping center with other local merchants including Dearman\'s and Calvin\'s grocery. If you lose your way, look for Le Madeline on the corner for a landmark.&nbsp;<\\/p>\",\"1\":\"We are a locally owned eyewear boutique with an exciting selection of classic, sophisticated eyewear. In business for over 30 years, the Optical Shoppe was the first luxury eyewear boutique in Baton Rouge.\",\"8\":\"225-926-2808\",\"7\":\"225-928-5798\",\"4\":\"The Optical Shoppe\"}}', '2014-03-19 19:04:09', '2014-03-19 19:04:09', '6290edbe-12f9-4aa6-ba2b-9c48ff1ecb91');
